import React, { Component } from 'react'
import './App.css';
import { Button,message} from 'antd';

import Login from './pages/login';

export default class App extends Component {
  handleClick = ()=>{
    message.success('yes...')
  }
  render() {
    return (
      <div>
        <Login />
        <Button type="primary" onClick={this.handleClick}>Primary</Button>
      </div>
    )
  }
}
